import styled from 'styled-components'


export const Nav = styled.nav`
    background : red;
    height : 80px;
    display : flex;
    justify-content : center;
    align-items : center;
    font-size : 1.2rem;
    position: sticky;
    top : 0;
    z-index: 999;
    
`;
